DROP TABLE IF EXISTS transaction_verification;

CREATE TABLE `transaction_verification` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `txid` varchar(200) NOT NULL,
  `t_type` varchar(200) NOT NULL COMMENT 'Deposit OR Withdraw',
  `p_type` varchar(50) NOT NULL COMMENT 'Cash OR Bank',
  `acctno` varchar(200) NOT NULL,
  `uname` varchar(50) NOT NULL,
  `transfer_to` varchar(200) NOT NULL,
  `fn` varchar(200) NOT NULL,
  `ln` varchar(200) NOT NULL,
  `email` varchar(300) NOT NULL,
  `phone` varchar(200) NOT NULL,
  `amount` varchar(200) NOT NULL,
  `posted_by` varchar(50) NOT NULL,
  `remark` text NOT NULL,
  `date_time` varchar(20) NOT NULL,
  `branchid` varchar(50) NOT NULL,
  `sbranchid` varchar(50) NOT NULL,
  `currency` varchar(10) NOT NULL,
  `cust_balance` varchar(50) NOT NULL,
  `till_balance` varchar(50) NOT NULL,
  `otp_code` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS transfer_history;

CREATE TABLE `transfer_history` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `userid` varchar(50) NOT NULL,
  `transfer_id` varchar(100) NOT NULL,
  `reference` varchar(150) NOT NULL,
  `account_number` varchar(50) NOT NULL,
  `fullname` varchar(20) NOT NULL,
  `bank_code` varchar(10) NOT NULL,
  `bank_name` varchar(100) NOT NULL,
  `currency` varchar(10) NOT NULL,
  `amount` varchar(100) NOT NULL,
  `transfers_fee` varchar(50) NOT NULL,
  `status` varchar(50) NOT NULL COMMENT 'NEW or FAILED or SUCCESSFUL',
  `narration` text NOT NULL,
  `date_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS transfer_recipient;

CREATE TABLE `transfer_recipient` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `companyid` varchar(50) NOT NULL,
  `recipient_id` varchar(100) NOT NULL,
  `full_name` varchar(200) NOT NULL,
  `acct_no` varchar(50) NOT NULL,
  `bank_code` varchar(200) NOT NULL,
  `bank_name` varchar(200) NOT NULL,
  `date_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS ugandan_pmt_confirmation;

CREATE TABLE `ugandan_pmt_confirmation` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `refid` varchar(100) NOT NULL,
  `acctbank` varchar(10) NOT NULL,
  `acctno` varchar(15) NOT NULL,
  `currency` varchar(10) NOT NULL,
  `debit_currency` varchar(10) NOT NULL,
  `amount` varchar(50) NOT NULL,
  `bname` varchar(150) NOT NULL,
  `reasons` text NOT NULL,
  `phone` varchar(15) NOT NULL,
  `otp_code` varchar(10) NOT NULL,
  `date_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS user;

CREATE TABLE `user` (
  `userid` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(200) NOT NULL,
  `email` varchar(200) NOT NULL,
  `phone` varchar(200) NOT NULL,
  `addr1` text NOT NULL,
  `addr2` text NOT NULL,
  `city` varchar(200) NOT NULL,
  `state` varchar(200) NOT NULL,
  `zip` varchar(200) NOT NULL,
  `country` varchar(200) NOT NULL,
  `comment` varchar(200) NOT NULL,
  `username` varchar(200) NOT NULL,
  `password` varchar(200) NOT NULL,
  `id` varchar(200) NOT NULL,
  `image` text NOT NULL,
  `role` varchar(200) NOT NULL,
  `branchid` varchar(100) NOT NULL,
  `utype` varchar(200) NOT NULL COMMENT 'Registered OR Unregistered',
  `created_by` varchar(50) NOT NULL,
  `bprefix` varchar(50) NOT NULL,
  PRIMARY KEY (`userid`)
) ENGINE=InnoDB AUTO_INCREMENT=719 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS user_role;

CREATE TABLE `user_role` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `user_id` varchar(100) NOT NULL,
  `perm_role` varchar(200) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=85 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS wallet_history;

CREATE TABLE `wallet_history` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `userid` varchar(50) NOT NULL,
  `refid` varchar(100) NOT NULL,
  `amount` varchar(50) NOT NULL,
  `currency` varchar(10) NOT NULL,
  `paymenttype` varchar(150) NOT NULL,
  `card_bank_details` text NOT NULL,
  `status` varchar(50) NOT NULL COMMENT 'successful or failed',
  `date_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;



DROP TABLE IF EXISTS withdrawal_note;

CREATE TABLE `withdrawal_note` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `mytid` varchar(50) NOT NULL,
  `b_id` varchar(50) NOT NULL,
  `c_id` varchar(50) NOT NULL,
  `status` varchar(50) NOT NULL,
  `wnote` text NOT NULL,
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



DROP TABLE IF EXISTS withdrawal_request;

CREATE TABLE `withdrawal_request` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `wid` varchar(100) NOT NULL,
  `b_id` varchar(50) NOT NULL,
  `c_id` varchar(50) NOT NULL,
  `w_details` text NOT NULL,
  `w_amount` varchar(200) NOT NULL,
  `interest_rate` varchar(50) NOT NULL,
  `amt_withdrawable` varchar(50) NOT NULL,
  `w_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `wstatus` varchar(100) NOT NULL COMMENT 'Approved or Declined or Pending',
  `branchid` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;



